import React from 'react';
import ReactPlayer from 'react-player';
import './YoutubeEmbed.css';

const YouTubeEmbed = () => (
        <div className="Player">
            <ReactPlayer
            url="https://www.youtube.com/watch?v=hpfLKbjTWn0&start_radio=1"
            controls="on"
            width="300px"
            height="300px" />
        </div>
);

export default YouTubeEmbed;
